<template>
  <div class="page-classify">
    <normal-header title="分类"></normal-header>
    <div class="classify-main">
      <header-type :types = "types" @click="onChange"></header-type>
      <cartoon-list></cartoon-list>
    </div>
  </div>
</template>

<script>
import NormalHeader from '@/components/NormalHeader'
import HeaderType from '@/components/HeaderType'
import CartoonList from '@/components/CartoonList'
import { getTypes } from '@/api/cartoon'
import { unformat } from '@/utils/apiHelp'
export default {
  name: 'Classify',
  components: {
    NormalHeader,
    HeaderType,
    CartoonList
  },
  data () {
    return {
      types: []
    }
  },
  methods: {
    onChange (payload) {
      console.log(payload)
    },
    getTypes () {
      getTypes().then(res => {
        if (res.code === 200) {
          this.types = res.info
        } else {
          alert(res.code_msg)
        }
      }).catch(err => {
        console.log(err)
        alert('网络异常，请稍后重试')
      })
    }
  },
  created () {
    this.getTypes()

    var str = ''
    console.log(unformat(str))
  }
}
</script>

